import React, { Fragment } from 'react';

export const Person = ({name, children, age}) => (
  <Fragment>
    <p>I AM A Person</p>
    <p>Name: {name}</p>
    <p>Age: {age}</p>
    <p>{children}</p>
  </Fragment>
)

export default Person;
